    position: absolute;
    left: 0;
    top:30px;
`

const MainChatLogContainer = () => {
    return (
        <MainChatLogPresenter>
            <BubbleBox>
                <Pp>name</Pp>
            </BubbleBox>
        </MainChatLogPresenter>
    )
}

export default MainChatLogContainer;
